import React, {useState} from "react";
import './Footer.css'
import home from '../assets/homeicon.svg'
import exit from '../assets/exitacc.svg'
import history from '../assets/history2.svg'
import attention from '../assets/attention.svg'
import {useNavigate} from "react-router-dom";
function Footer() {
    const navigate = useNavigate();
    const [focus, setFocus] = useState([{path:'', state:false}, {path:'abcient', state:false}]);
    function handleSubmit() {
        localStorage.removeItem('user');
        navigate('/')
    }

    function handleClickButton() {
        navigate('')

    }
    return (
        <div className={'nav-bar'} style={{display: 'flex', justifyContent: 'space-around'}}>

            <button onClick={()=>navigate('')} style={{borderBottom:'solid white', height:'min-content' }}><img className={'icons-menu'} src={home} alt={'home'}/></button>
            <button onClick={()=>navigate('abcient')}><img className={'icons-menu'} src={attention} alt={'home'}/></button>
            <button onClick={() => handleSubmit()}><img className={'icons-menu'} src={exit} alt={'home'}/></button>
        </div>
    )

}

export default Footer;
